import { Table } from 'react-bootstrap'
import axios from 'axios'


export const Home = () => {
    const [user, setUser] = useState({})

    const dataUsers = axios.get('http://localhost:8080/api/data/1').then((res)=>{

        setUser(res.data)
    })

   
    // const { data } = res
    // const  { users, metrics } = data;

    // console.log(users);

    
    return (
        <div>
            &nbsp;
            <h1 style={{ textAlign: "center" }}>Usarios</h1>
            <Table className='table' striped>
                &nbsp; &nbsp; &nbsp; &nbsp;
                <thead>
                    <tr>
                        <th>
                            ID
                        </th>
                        <th>
                            Nombre
                        </th>
                        <th>
                            Metrica
                        </th>
                        <th>
                            Username
                        </th>
                    </tr>
                </thead>
                <tbody>
                    {
                        user.map( user => (
                            <Fragment>
                            <tr>
                                <th scope="row">
                                    {user.id}
                                </th>
                                <td>
                                    {user.name}
                                </td>
                                <td>
                                    Otto
                                </td>
                                <td>
                                    @mdo
                                </td>
                            </tr>
                            </Fragment>
                        ))
                
                    }   
                </tbody>
            </Table>

        </div >

    )
}

export default Home
